function qte(a){mFe(a.j,'This module teaches how IEEE floats are stored in binary.');mFe(a.j,"We're going to be working with a 16 bit numbers...");mFe(a.j,'... but the process is the same for 32bit and 64bit numbers.');mFe(a.j,Fof);mFe(a.j,Gof);mFe(a.j,"Let's figure out how to store the number below.");mFe(a.j,'The first step is to convert the number to plain old binary.');mFe(a.j,'The easiest way to do this, is to separate our number into two parts.');mFe(a.j,'The first part is the whole number portion(left of the decimal point).');mFe(a.j,'The second part is the fractional portion; (right of the decimal point).');mFe(a.j,'We can convert the whole number part by repeatedly dividing by 2!');mFe(a.j,'Everytime we get a remainder, the remainder becomes a digit!');mFe(a.j,'So, we just repeatedly divide our result by 2, and record the remainders.');mFe(a.j,'Eventually, we get zero as a result (and we stop our divisions)');mFe(a.j,"An example will make this clearer, let's work it out.");mFe(a.j,"When you see a flashing '|' cursor, type the answer.");mFe(a.j,Hof);mFe(a.j,'Fill in the answers, or press enter to see the correct value.');mFe(a.j,'Note: each division builds the binary number in reverse...');mFe(a.j,"...that's why we wrote our divisions backwards (right to left)...");mFe(a.j,'... doing the divisions right to left makes it easier to read.');mFe(a.j,'Now, the red remainders represent the whole number portion in binary.');mFe(a.j,'Next, we need to convert the numbers to the right of the decimal point');mFe(a.j,'The fractional portion is converted by a series of multiplications');mFe(a.j,'So, instead of dividing, we multiply our fractional portion by 2 ...');mFe(a.j,"...the result's *whole* number portion tells us a digit");mFe(a.j,"That is, if '0' is to the left of the decimal, then the next binary digit is 0.");mFe(a.j,"If a '1' is to the left of the decimal, then the next binary digit is 1!");mFe(a.j,'Just like in the previous dividing steps, we keep multiplying to get more digits!');mFe(a.j,'One small note though...');mFe(a.j,'if we get a 1, then we must subtact 1 before the next multiplication...');mFe(a.j,"...don't worry, that will become clear with the example.");mFe(a.j,"Now let's get started with the fractional part...");mFe(a.j,Iof);mFe(a.j,'Keep multiplying the numbers until we get zero, or run out of space.');mFe(a.j,'We ran out of space... this may be a repeating number in binary!');mFe(a.j,'Some numbers repeat in binary, like 1/3 (0.333) does in decimal.');mFe(a.j,'If a number is repeating, we store as many digits as we can.');mFe(a.j,"Back to the task, IEEE floats don't store converted number directly...");mFe(a.j,'... to store the number we need to first convert it to scientific notation.');mFe(a.j,'Before I explain this, there is a slight change in language I need to explain.');mFe(a.j,"When we're dealing with decimal numbers, we call the ' . ' a 'decimal point'.");mFe(a.j,"When we're dealing with binary numbers, we could the ' . ' a 'binary point'.");mFe(a.j,"In a more general sense, we could just call the ' . ' a 'radex point'");mFe(a.j,"However, I'm going to keep refering to the ' . ' as a decimal point, regardless of our base.");mFe(a.j,'Now then, to convert our number to scientific notation!');mFe(a.j,'Just like in decimal scientific notation, we move the decimal point.');mFe(a.j,'Normally, every time we move decimal point, we have to multiply by a power of 10.');mFe(a.j,'But in binary, we multiply by a power of 2 -- instead of 10.');mFe(a.j,Jof);mFe(a.j,'Press enter move the decimal point, notice the change in power of 2.');mFe(a.j,"Now we're almost done, but not quite...");mFe(a.j,"...IEEE doesn't directly store the scientific notation...");mFe(a.j,'...it stores other data too, such as positive/negative bit and the exponent of 2.');mFe(a.j,Kof);mFe(a.j,'The IEEE floating point is broken up into 3 pieces.');mFe(a.j,'it consists of,  1 sign bit, 5 exponent bits, and 10 Mantissa bits.');mFe(a.j,'The 01111 is related to the exponent, but we will get to that in a moment.');mFe(a.j,'The mantissa is where we store the scientific notation number.');mFe(a.j,'The mantissa is the right hand 10 bits, colored purple.');mFe(a.j,'Press enter to move our binary number to the final conversion.');mFe(a.j,Lof);mFe(a.j,'If we have any extra bits, we pad them with zeros.');mFe(a.j,'You may have noticed that we did not store the whole number before the decimal.');mFe(a.j,'This is actually a space saving mechanism');mFe(a.j,'Remember, in binary digits are either 0 and 1...');mFe(a.j,'...if digit left of the decimal place were 0, it would be invalid scientific notation...');mFe(a.j,"That is, we don't write '0.11 x 2^2', instead we write '1.1 x 2^1'");mFe(a.j,'This is because in scientific notation we only have a single digit whole number portion.');mFe(a.j,'So, the leftmost digit must be 1, since there are no other characters in binary.');mFe(a.j,'Thus, we can save one bit by not including the first 1 in our conversion!');mFe(a.j,"Now, let's store the exponent of the 2");mFe(a.j,'Because we can have positive or negative exponents... ');mFe(a.j,"...we won't store the exponent directly.");mFe(a.j,"Instead of directly using 2s complement, IEEE uses a 'bias' value.");mFe(a.j,'This bias value is 01111 for 16 bits.');mFe(a.j,'Now, 01111 is basically an unsigned value that represents a 0 exponent.');mFe(a.j,'So, if 01111 is in our exponent bits, then we have a 0 exponent');mFe(a.j,Mof);mFe(a.j,'The next step is to add our exponent to this 01111 bias.');mFe(a.j,'As a result, positive exponents add and become larger than the 01111...');mFe(a.j,'...and negative exponents add to 01111 and become smaller than the 01111!');mFe(a.j,'This is how we can store negative and positive exponents!');mFe(a.j,Nof);mFe(a.j,'Now, add together our exponent with the bias value.');mFe(a.j,Oof);mFe(a.j,'The last thing we need to do is store the sign of the converted value.');mFe(a.j,'We simply store a 0 for positive numbers, and a 1 for negative numbers.');mFe(a.j,'Since our value is positive, the first bit becomes a 0.');mFe(a.j,Pof);mFe(a.j,"And that is it, we're done converting the number!");mFe(a.j,'You can press spacebar at any time to see the available keybinds.');mFe(a.j,'At anytime you get stuck, simply press enter to see the next step.');mFe(a.j,'You may want to first have the computer walk you through a few.');mFe(a.j,'But do try and solve some yourself. :)');mFe(a.j,'Press n to randomly generate a new problem for practice.')}
